import React from "react";

const TopPartners = () => {
  const partners_list = [
    { src: "/img/partnership/certik.png", title: "CertiK" },
    { src: "/img/partnership/slowmist.svg", title: "SlowMist" },
    { src: "/img/partnership/ethereum.png", title: "Ethereum Foundation" },
    { src: "/img/partnership/certik.png", title: "Binance Smart Chain (BSC)" },
    { src: "/img/partnership/certik.png", title: "Solana" },
    { src: "/img/partnership/github.png", title: "Github" },
    { src: "/img/partnership/certik.png", title: "Google Cloud Blockchain" },
    { src: "/img/partnership/certik.png", title: "" },
    { src: "/img/partnership/certik.png", title: "Aave" },
  ];

  return (
    <div className="partner-area pb-130">
      <div className="container">
        <div className="row justify-content-center">
          <div className="col-lg-8">
            <div className="section-title text-center mb-10">
              <span className="sub-title">Our top partner</span>
            </div>
          </div>
        </div>
        <div className="row">
          <div className="col-lg-12">
            <div className="partner-wrap">
              <ul>
                {partners_list.map((item, index) => (
                  <li key={index} className="color-li">
                    <img
                      src={item.src}
                      alt={item.title}
                      className="partner-img"
                    />
                  </li>
                ))}
              </ul>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default TopPartners;
